  input: TEXT,F3XA,,"In response to your letter of November 16, 2005 regarding our
    June Monthly Report (5/1/05-5/31/05), the Schedule B payments totaling $5,409.37
    for Direct Mail/Fundraising Expense and Postage were in fact in connection wth
    soliciting funds for the PARTY itself and not for any candidates.  The payment
    for Insurance on Schedule H4 was for the Party's General Liability Policy, and
    not health insurance for employees.  The $6,000 transfer to our non-federal account,
    was in fact to pay the employees paid from the non-federal account, an not for
    federal election activity.  The payments for IT Consulting and Janitorial Services,  are
    contracted amounts paid to non-employees.  The expenditures made for Fundraising
    Consultants were in connection with fundraising for the PARTY itself and not any
    candidates.  All other items have been corrected in this amendment."
